def send_to_telegram(name, phone, issue):
    anydesk_id = get_anydesk_id()
    rustdesk_id = get_rustdesk_id()
    local_ip = get_local_ip()
    host_name = get_host_name()
    computer_name, company_name, full_company_name = get_computer_info()
    global_ip = get_global_ip()
    message = (f"Имя: {name}\n"
               f"Телефон: {phone}\n"
               f"Проблема: {issue}\n"
               f"AnyDesk ID: {anydesk_id}\n"
               f"RustDesk ID: {rustdesk_id}\n"
               f"Имя компьютера: {host_name}\n"
               f"Локальный IP: {local_ip}\n"
               f"Глобальный IP: {global_ip}\n"
               f"Название устройства {computer_name}\n"
               f"Компания: {company_name}\n"
               f"Полное имя компании {full_company_name}\n")

    url = f"https://api.telegram.org/bot{bot_token}/sendMessage"
    payload = {"chat_id": chat_id, "text": message}

    try:
        response = requests.post(url, data=payload, timeout=5)
        if response.status_code == 200:
            print("Данные успешно отправлены в Telegram!")
        else:
            print("Не удалось отправить данные.")
    except Exception as e:
        print(f"Ошибка при отправке: {e}")


def send_to_yougile(name, phone, issue):
    anydesk_id = get_anydesk_id()
    rustdesk_id = get_rustdesk_id()
    local_ip = get_local_ip()
    host_name = get_host_name()
    computer_name, company_name, full_company_name = get_computer_info()
    global_ip = get_global_ip()

    header = {
        'Content-Type': 'application/json',
        'Authorization': f'Bearer {yougile_api}'
    }
    url = "https://ru.yougile.com/api-v2/tasks"
    data = {
        "title": f"{company_name} - {issue}",
        "columnId": f"{column_id}",
        "archived": False,
        "completed": False,
        "subtasks": [],  # Массив Id подзадач
        "assigned": [],  # Массив Id пользователей, на которых назначена задача
        "deadline": {
            "deadline": round(time.time() * 1000) + 3600000,  # Текущее время в миллисекундах + 1 час
            "withTime": True,
            "history": [
                "string"
            ],
        }
    }

    data_json = json.dumps(data)

    try:
        response = requests.post(url, data=data_json, headers=header, timeout=5)

        if response.status_code == 201:
            task_id = response.json()['id']
            url = f'https://ru.yougile.com/api-v2/chats/{task_id}/messages'
            message = {
                "text": f"Имя: {name}\n"
                        f"Телефон: {phone}\n"
                        f"Проблема: {issue}\n"
                        f"AnyDesk ID: {anydesk_id}\n"
                        f"RustDesk ID: {rustdesk_id}\n"
                        f"Имя компьютера: {host_name}\n"
                        f"Глобальный IP: {global_ip}\n"
                        f"Локальный IP: {local_ip}\n"
                        f"Название устройства {computer_name}\n"
                        f"Компания: {company_name}\n"
                        f"Полное имя компании: {full_company_name}\n",
                "label": "Данные по заявке"
            }
            data_json = json.dumps(message)
            requests.post(url, data=data_json, headers=header, timeout=5)

            messagebox.showinfo("Успех", "Заявка успешно создана!")
        else:
            messagebox.showerror("Ошибка", "Не удалось отправить данные.")
            print("Ошибка:", response.status_code)
    except Exception as e:
        messagebox.showerror("Ошибка", f"Ошибка при отправке: {e}")


