def open_input_window():
    global window_instance

    if window_instance is not None and window_instance.winfo_exists():
        window_instance.lift()
        window_instance.deiconify()
        return

    window_instance = create_window()


# Создание значка в трее
def create_image(
        icon_base64=''):
    image_data = base64.b64decode(icon_base64)
    return Image.open(BytesIO(image_data))


tray_image = create_image(
    '')
image = create_image()
icon_tk = ImageTk.PhotoImage(image)
root.iconphoto(False, icon_tk)


def on_quit(icon, item):
    os._exit(0)


icon = Icon("Поддержка NSKPC", tray_image, menu=Menu(
    MenuItem("Открыть окно", lambda *args: root.after(0, open_input_window), default=True),
    MenuItem("Выход", on_quit)
))


def run_tray():
    icon.run()


if __name__ == "__main__":
    start_update_check()
    threading.Thread(target=run_tray, daemon=True).start()
    root.mainloop()
